import React, { useState, useEffect } from 'react'
import SocialService from '../services/SocialService'

const ListSocialComponent = () => {

  const [socials, setSocials] = useState([])  

  useEffect(() => {
    SocialService.getAllSocials().then((response) => {
        setSocials(response.data)
        console.log(response.data)
    }).catch(error => {
        console.log(error);
    })
  }, [])


  return (
    <div className = "container">
        <h2 className = "text-center"> List Socials</h2>
        <Link to = "/add-social" className = "btn btn-primary mb-2" ></Link>
        <table className = "table table-bordered table-striped">
            <thead>
                <th> Social Id</th>
                <th> Social First Name </th>
                <th> Social Last Name </th>
                <th> Social Email Id </th>
            </thead>
            <tbody>
                {
                    socials.map(
                        social =>
                        <tr key = {social.id}>
                            <td> {social.id}</td>
                            <td> {social.firstName}</td>
                            <td> {social.lastName}</td>
                            <td> {social.emailId}</td>
                        </tr>
                    )
                }
            </tbody>
        </table>
    </div>
  )
}

export default ListSocialComponent
